import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import '../css/Navbar.css';

const Navbar1 = () => {
  const [isOpen, setIsOpen] = useState(false);

  const toggleMenu = () => {
    setIsOpen(!isOpen);
  };

  return (
    <header className="navbar">
      <div className="navbar__logo">MyLogo</div>
      
      {/* Toggle button */}
      <button></button>
      <div className={`navbar__toggle ${isOpen ? 'active' : ''}`} onClick={toggleMenu}>
        <span className="navbar__toggle-icon"></span>
        <span className="navbar__toggle-icon"></span>
        <span className="navbar__toggle-icon"></span>
      </div>

      <nav className={`navbar__menu ${isOpen ? 'active' : ''}`}>
        <ul className="navbar__list">
          <li className="navbar__item">
            <Link to="/" className="navbar__link">Home</Link>
          </li>
          <li className="navbar__item">
            <Link to="/about" className="navbar__link">AlumniDashBoard</Link>
          </li>
          <li className="navbar__item">
            <Link to="/services" className="navbar__link">DonationPortal</Link>
          </li>
          <li className="navbar__item">
            <Link to="/contact" className="navbar__link">Events</Link>
          </li>
        </ul>
      </nav>
    </header>
  );
};

export default Navbar1;
